import React from 'react';
import PropTypes from 'prop-types';
import Section from 'components/Section';

class Home extends React.Component {
    render() {
        const {
            data
        } = this.props;
        return (
            <div>
                {data.map((sectionData) => (
                    <Section 
                        data={sectionData.sections}
                    />
                ))}
            </div>
        );
    }
}

export default Home;
